import React from 'react';
import { Card, Icon, Image} from 'semantic-ui-react';

 const MovieCard = ({ movie }) => (
  <Card>
     <Image src={movie.cover}/>
     <Card.Content>
         <Card.Header>
              {movie.title}
         </Card.Header>
     </Card.Content>
   </Card>


 )

export default MovieCard;
